   325→
   326→        <p><b>Mnemonic commons</b> (singular: <b>mnemonic common</b>) are theoretical shared memory structures hypothesized to exist across populations of individuals who have experienced similar events or cultural phenomena. First described by researchers at the <a href="/wiki/University_of_Edinburgh">Edinburgh Institute for Consciousness Studies</a> as part of the ongoing Collective Memory Project, mnemonic commons represent a proposed mechanism by which individual memories may become partially pooled, allowing for both reinforcement and <a href="/wiki/Interference_theory">interference</a> between minds.<sup><a href="#cite1">[1]</a></sup></p>
   327→
   328→        <p>The concept draws heavily from <a href="consciousness-archaeology.html">consciousness archaeology</a> and its stratigraphic model of mind, extending the framework to suggest that certain experiential layers may extend beyond individual consciousness into shared cognitive territory—much as underground aquifers span property boundaries invisible from the surface.<sup><a href="#cite2">[2]</a></sup></p>
